The read and write operations are available for operating on memories. Both operations take the name of the memory as an argument, e.g. read MEM. When reading, the value currently stored in the memory at the position of the address register is written to the data register. In the case of writing, the process is exactly the opposite: The value from the data register is written into the memory. ~declare register AR(3:0), DR(3:0)
~declare memory MEM(AR, DR)
~
# Read value at position 4
AR <- 4;
read MEM; # Write (value + 1) back to the memory
DR <- DR + 1;
write MEM;
